import React, { Component } from 'react'

export default class App2 extends Component {
    render() {
//        return (
//            <div>
//  /              
//            </div>
//       )
        return React.createElement(
            'div',
            {className: 'App'},
            React.createElement(
                'h1',
                null,
                'Hello world!'
            )
        )
    }
}
